/* Procedure structure for procedure `q1` */

/*!50003 DROP PROCEDURE IF EXISTS  `q1` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `q1`(IN `userid` int, IN `curPage` int, OUT `row_PerPage` int, OUT `maxRowCount` int, OUT `maxPage` int
	
)
begin 
	
	#输出每页的行数pagenum
	-- 通过输入的用户id（游客按id=999进行查询），查询出bbsuser表中的pagenum字段的值；
	set @pagenum := 0;  -- 每页的行数
	if userid = 999 then
		set @pagenum := 5;
	else 
	   select rowsPerPage into @pagenum
	   from bbsuser
	   where id = userid;
	end if;
	set row_PerPage = @pagenum;
	
	#输出最大行数
	select count(*) into maxRowCount
	from article
	where rootid = 0;
	
	#输出最大页数
	set maxPage = ceil(maxRowCount/@pagenum);
	
	#查询出每页的数据
	set @sql := " select * from article a inner join bbsuser b on (a.userid=b.id) where a.rootid=0 order by a.id desc limit ";
	set @p1 := (curPage-1)*@pagenum;
	set @p2 := concat(@sql, @p1, ',', @pagenum);
	prepare stmt from @p2;
	execute stmt;
	
